import i404 from "../../resc/i404.png"
import "../../css/app.css"
import { useNavigate } from "react-router-dom";

const Page404 = () => {
    const nav = useNavigate()
    return (
        <div className="page-wrapper-404">
            <img src={i404}></img>
            <button onClick={nav("/")}>Main Page</button>
        </div>
    )
}

export default Page404;
